import React from 'react';
import styles from './Header.css';

const Header = () => {
  return (
    <header className={styles.header}>
      <div className={styles.contents}>
        <div>김나영 포트폴리오</div>

        <nav className={styles.navigation}>
          <ul>
            <li>메뉴1</li>
            <li>메뉴2</li>
            <li>메뉴3</li>
          </ul>
        </nav>
      </div>
    </header>
  )
}

export default Header
